import React, { useContext } from 'react'
import { Button } from '@material-ui/core';
import { QuestionnaireContext } from '../../contexts/QuestionnaireContext';

const UndoButton = () => {
  const { timeline, dispatchTimeline } = useContext(QuestionnaireContext);

  return (
    <Button disabled={timeline.past.length > 0 ? false : true} onClick={() => dispatchTimeline({ type: "UNDO" })}>
      undo
    </Button>
  )
}

export default UndoButton;
